met Sylvester Stallone, Jason Statham en Bruce Willis

De louche CIA agent Church (Bruce Willis) stuurt de Expendables, een groep huurlingen, opnieuw op een gevaarlijke missie. 
De groep moet een vermist pakketje zien terug te krijgen bij het agentschap. Het pakketje is echter in Gazak, 
een door oorlog verscheurd Oost-Europees land. De missie loopt in het honderd wanneer blijkt dat een andere groep huurlingen, 
de Sangunaires, dezelfde opdracht probeert uit te voeren.



